--
-- MySQL 5.0.67
-- Sat, 17 Oct 2009 13:25:21 -0400
--

CREATE DATABASE `bgundead` DEFAULT CHARSET latin1;

USE `bgundead`;

CREATE TABLE `event_roster` (
   `epid` int(11),
   `eid` int(11),
   `mid` int(11),
   PRIMARY KEY (`epid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `events` (
   `eid` int(11),
   `title` varchar(50),
   `desc` text,
   `location` varchar(25),
   `start` int(11),
   `end` int(11),
   `end_reg` int(11),
   `type` varchar(1),
   `started` tinyint(1),
   PRIMARY KEY (`eid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `game_op` (
   `goid` int(11),
   `eid` int(11),
   `mid` int(11),
   `status` varchar(3),
   `timeofdeath` int(11),
   `killed_by` int(11),
   `killcode` varchar(8),
   `killedX` int(11),
   `killedY` int(11),
   `active` tinyint(1),
   PRIMARY KEY (`goid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `members` (
   `mid` int(11),
   `email` varchar(50),
   `username` varchar(20),
   `password` varchar(20),
   `fname` varchar(20),
   `lname` varchar(20),
   `handle` varchar(16),
   `rid` int(11),
   `eid` int(11),
   `joinDate` timestamp,
   `prefer_oz` tinyint(1),
   `read_rules` tinyint(1),
   `admin` tinyint(1),
   PRIMARY KEY (`mid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `news` (
   `nid` int(11),
   `title` varchar(50),
   `story` text,
   `time` int(11),
   `mid` int(11),
   PRIMARY KEY (`nid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `res_hall` (
   `rid` int(11),
   `name` varchar(50),
   `clan` varchar(25),
   PRIMARY KEY (`rid`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;


CREATE TABLE `tbTest` (
   `intTestId` int(10),
   PRIMARY KEY (`intTestId`)
) ENGINE=InnoDB DEFAULT CHARSET latin1;


CREATE TABLE `zombie_food` (
   `zfid` int(11),
   `eid` int(11),
   `foodcode` varchar(8),
   `eaten_by` int(11),
   `time_eaten` int(11),
   PRIMARY KEY (`zfid`),
   UNIQUE KEY (`foodcode`)
) ENGINE=MyISAM DEFAULT CHARSET latin1;

