INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('20', 'Fall Semester Game', 'WOOHOO!  Nerf blasters make their return in the Fall Classic!  Grab your bandanna, and let the foam fly!', 'BGSU Campus', '1224759600', '1225422000', '1225036800', 'G', '1');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('35', 'MISSION 2', 'MISSION 2: ANTIDOTE CACHE<br><br>AMNESTY BEGINS AT 7PM.<BR><BR>MEET @ SADDLEMIRE @ 7:30PM FOR BRIEFING.', 'Meet @ Saddlemire Field', '1225236600', '1225240200', '1225238400', 'M', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('34', 'Scientist', '<b><u>Amnesty starts at 8 for this event.</u></b>\r\n<br /><br />\r\nA scientist must be escorted across campus.  Which side will have the scientist when all is said and done?', 'Saddlemire Wasteland', '1225067400', '1225072800', '1225036800', 'M', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('36', 'Birthday Butchery', 'Come celebrate the birth of Steve Currie (AKA Fearless Leader) NERF style!', 'Eppler 221', '1232834400', '1232845200', '1232751600', 'M', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('37', 'Welcome Back Rotter', 'First monthly meeting of the new year!</br></br>\r\nAgenda includes discussion of Admin/Moderator naming and constitution changes, the web admin position, t-shirt orders, and upcoming events.', '117 Olscamp', '1232913600', '1232920800', '1232751600', 'E', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('39', 'Welcome Back Rotter (Take 2)', 'Due to the mixture of events that conflicted with the last meeting we re going to hold another meeting this Sunday, February 8th in 101 Olscamp. T-Shirt preorders will be taken as well as all orders of business that was scheduled for the last meeting (like Webmaster position, Moderator/Admin nomenclature, etc.) Hope to see you all there!!', 'Olscamp 117', '1234123200', '1234130400', '1233586800', 'E', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('40', 'March Madness/April Ghouls', 'This Spring Semester\'s official Humans vs. Zombies Game!', 'BGSU Campus', '1238040000', '1238729400', '1238036400', 'G', '1');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('41', 'The Fall Classic', 'Rock your Pink Bandannas in this Fall\'s game!  We\'re shooting for 600 players this time around so make sure you register in time.  If you don\'t have your bandanna yet, don\'t worry, they will be made available in the union in the weeks leading up to the game.', 'BGSU Main Campus', '1256184000', '1256871600', '1256169600', 'G', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('42', 'September General Meeting', 'At the meeting we will be discussing the new bandana color, the new game date, and, tentatively, there will be food. So, mark your calendars.<br /><br />\r\nTHIS MEETING IS NOT MANDATORY TO PARTICIPATE IN THE GAME.', 'Union Multi-Purpose Room ', '1253383200', '1253390400', '1253412000', 'E', '0');
INSERT INTO `events` (`eid`, `title`, `desc`, `location`, `start`, `end`, `end_reg`, `type`, `started`) VALUES ('43', 'October Meeting', 'The last meeting before the Fall Game, at this meeting we will be selling bandannas as well as going over any last minute rules updates for this semester.  This will also be your last chance to order T-Shirts and Hats for the fall.', 'Not Yet Set', '1255809600', '1255816800', '1262196000', 'E', '0');
