INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('13', 'Mission Tonight!', 'It\'s what you\'ve all been waiting for...THE SCIENTIST MISSION!!!\r\n<br /><br />\r\nHere\'s the deal. Amnesty will start at 8 o\'clock tonight. Please meet at the Saddlemire Wasteland by 8:30. From there we\'ll direct players to their spots and the mission will start around 9.\r\n<br /><br />\r\nTell your friends!\r\n<br /><br />\r\nBring your ammo or sharpen your fangs. It\'s on.\r\n\r\n', '1225045122', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('15', 'MISSION TUESDAY EVENING', 'Keep your evening open!  Next mission is Tuesday PM.', '1225139978', '8');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('9', 'ATTENTION PLAYERS', 'The game has been started and zombies have been tagged!  If you screen has a code, you are a human.  It\'ll be obvious if you are a zombie. <u><b>If you don\'t have any sort of text under your logout button, you haven\'t registered for the game under the events link; DO SO NOW AND JOIN THE FUN!!!</b></u>  Also, if you don\'t have an email in you profile, we can\'t get a hold of you.  <u><b>UPDATE PROFILES TO INCLUDE EMAIL, I\'M TALKING TO ANYONE WHO REGISTERED BEFORE MONDAY!</b></u> Good luck!', '1224735613', '1');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('10', 'MEETINGS CANCELLED', 'Meetings canceled, due to weather.  We will talk before the Sunday Mission.', '1224879965', '8');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('12', 'Thank you', 'A big thank you to all those who helped us fix the \"thumbtack\" situation! With your help, it was resolved quickly, and to the complete satisfaction of the police and administration. ', '1224893469', '8');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('14', 'SUNDAY MISSION RESULTS', 'The mission last night was a DRAW.  The Humans fought bravely, and the Zombies were hungry, but unfortunately the mission was not a win for either side.\r\n\r\nThe admins called the draw after mass chaos (the bad kind) and confusion led to injuries.', '1225139946', '8');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('16', 'IMPORTANT! Limited Play Hours', 'Ok, there are two orders of business here and it is crucial that EVERY MEMBER follows these to a tee. \r\n<br>\r\n<br>1.) The Governor will be ON CAMPUS tomorrow (Tuesday October 28th) and because of that, between 1pm and 4pm NO ONE is allowed to play any further WEST than the front of the Student Union. Above all, stay AWAY from Prout Chapel.  If you are unsure of where those boundaries are, don\'t even head close to the Union while wearing a bandanna.\r\n<br>\r\n<br> 2.) Sarah Palin will be here at BGSU on Wednesday (October 29th) until 2 p.m.. This means NO BANDANNAS OR BLASTERS OUT OF ROOMS UNTIL AFTER 2PM. The secret service will be out and will not think twice before having to \"HANDLE\" potential threats (we were told this for OUR SAFETY), so put all Nerf blasters away and wait until 2 p.m. before fearing for your lives or feasting on brains.\r\n<br>\r\n<br>Tell everyone you know who is playing about these changes so the news will be spread fast. Thanks again.', '1225142163', '79');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('17', 'Meeting This Sunday!!', 'Bring out your dead!!  Or undead, as the case may be.  This Sunday will hold the first BG UNDEAD meeting of the New Year.  On the agenda are a couple of constitution amendments (Moderator position & naming, Web Admin position), t-shirt orders (there will be previews there), and the unveiling of upcoming events.  The upcoming semester looks to be an exciting one, so come help us start the new year off with a bang!', '1232753427', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('18', 'T-Shirt Sale', 'For all of you that missed the meeting this Sunday (and from the sounds of it, this includes everyone), T-shirts and hoodies will be sold at the Officer Meeting this Friday at 5:30 pm in the Dead Space above Harshman Bromfield.', '1233003178', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('19', 'Meeting This Sunday ... Again', 'Due to the mixture of events that conflicted with the last meeting we re going to hold another meeting this Sunday, February 8th in 117 Olscamp.  T-Shirt preorders will be taken as well as all orders of business that was scheduled for the last meeting (like Webmaster position, Moderator/Admin nomenclature, etc.)  Hope to see you all there!!', '1233587340', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('20', 'Site News', 'This site will be down over Spring Break as new features are added and preparations for this semester\'s game are made.\r\n</br></br>\r\nGame registrations will go live on <b>Monday, March 16th</b>.', '1236181716', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('21', 'This Bitch Is Global!', 'A few changes have been made.  You will have to sign a waiver before you can register for the game, for liability purposes of the school and this organization.  Also, you must now sign in using your email address instead of your username.  Your username will no longer be used.  This is not to be confused with your Nickname, which WILL still be used.  <b>If you cannot remember your email please click the Contact link above and an officer will be happy to help you!</b>\r\n<br /><br />\r\nMake sure to check your OZ preference and happy gaming!', '1237310647', '1');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('22', 'Remember!!!!!!', 'If you have only <b>SIGNED UP</b> for the website and have not gone under <b>EVENTS</b> and clicked <b>\"REGISTER FOR THIS GAME\"</b> then please do so as you will not be registered for this game, only this website. if you have played last year, you still have to register for this game, just not the website. \r\n<br />\r\n<br />\r\n<big>YOU HAVE UNTIL <u>11:30pm SHARP.</u></big>', '1238011434', '1');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('23', 'Mark Your Calendars - Mission TImes', 'The following are mission times for the upcoming game:\r\n<br /><br />\r\nFriday at 9:00pm.\r\n<br /><br />\r\nMonday at 9:30pm.\r\n<br /><br />\r\nTuesday at 9:00pm.\r\n<br /><br />\r\nThursday at 10:30pm for the Final Stand!\r\n<br /><br />\r\n<b>Amnesty will begin 90 minutes before each mission.</b>', '1238036108', '1');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('24', 'The Results Are In!!!', 'As most of you know, last night was the final stand.  The humans need to get 26 people in the Union Oval in order to achieve victory.  And, with a total count of 38, surpassed that goal to reclaim victory over the embarrassing defeat from this past Fall game.  Congratulation humans, and we hope to see everyone back this October for the Fall Classic!', '1238798575', '1');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('25', 'Site Changes', 'I am beginning work on an overhaul of this sites layout and features, including the addition of forum/social page.  I am up for suggestions about features you would like to see implemented.\r\n<br /><br />\r\nAny and all suggestions for changes to this site should be emailed to <a href=\"mailto:awross@bgsu.edu\">awross@bgsu.edu</a>.\r\n<br />\r\nThanks,<br />\r\nAndrew Ross<br />\r\n<br />\r\nWebmaster, BG Undead', '1245687886', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('26', 'We are now on Twitter!', 'Follow official BG Undead announcements on twitter <a href=\'http://www.twitter.com/bgundead\'>@bgundead</a>', '1253214422', '0');
INSERT INTO `news` (`nid`, `title`, `story`, `time`, `mid`) VALUES ('27', 'POLL', 'How many people have a Twitter? How many people would get one to better follow BG Undead news? Basically I\'m trying to figure out if it\'s worth implementing pictures, news and story features through Twitter.  Reply to \n<a href=\'www.facebook.com/group.php?gid=2223940803\'>Facebook</a> or <a href=\'www.twitter.com/bgundead\'>@bgundead</a>.', '1254444340', '0');
